-- Create Admin Role and User
DO $$
BEGIN
    -- Create the admin user with login
    CREATE USER admin_user WITH LOGIN PASSWORD 'admin_password';

    -- Create the admin role
    CREATE ROLE admin_role;

    -- Grant all database-level privileges to admin_role
    GRANT ALL PRIVILEGES ON DATABASE hotel_management TO admin_role;

    -- Give all privileges
    ALTER ROLE admin_user WITH SUPERUSER;
    ALTER ROLE admin_user WITH CREATEDB;
    ALTER ROLE admin_user WITH CREATEROLE;
    ALTER ROLE admin_user WITH BYPASSRLS;
    ALTER ROLE admin_user WITH INHERIT;
	
	-- Grant admin_role to admin_user
    GRANT admin_role TO admin_user;
END $$;



-- TABLE CREATION

-- Drop tables if they exist
DO $$
BEGIN
    DROP TABLE IF EXISTS Booking CASCADE;
    DROP TABLE IF EXISTS Guest CASCADE;
    DROP TABLE IF EXISTS Room CASCADE;
    DROP TABLE IF EXISTS Staff CASCADE;
    DROP TABLE IF EXISTS Hotel CASCADE;
    DROP TABLE IF EXISTS Users CASCADE;
END $$;

-- Table creation
CREATE TABLE Hotel (
    hotel_id SERIAL PRIMARY KEY,
    nameH VARCHAR(100),
    location VARCHAR(100),
    total_bookings INTEGER DEFAULT 0
);

CREATE TABLE Guest (
    guest_id SERIAL PRIMARY KEY,
    g_name VARCHAR(50),
    g_email VARCHAR(50),
    g_phone VARCHAR(20),
    repeated_guest CHAR(1) CHECK (repeated_guest IN ('Y', 'N')),
    previous_cancellations INTEGER,
    previous_bookings_not_canceled INTEGER
);

CREATE TABLE Room (
    room_id SERIAL PRIMARY KEY,
    hotel_id INTEGER REFERENCES Hotel(hotel_id),
    room_type VARCHAR(50),
    price NUMERIC(10, 2)
);

CREATE TABLE Staff (
    staff_id SERIAL PRIMARY KEY,
    hotel_id INTEGER REFERENCES Hotel(hotel_id),
    name VARCHAR(100),
    position VARCHAR(50),
    contact_info VARCHAR(100)
);

CREATE TABLE Booking (
    booking_id SERIAL PRIMARY KEY,
    guest_id INTEGER REFERENCES Guest(guest_id),
    hotel_id INTEGER REFERENCES Hotel(hotel_id),
    room_id INTEGER REFERENCES Room(room_id),
    no_of_adults INTEGER,
    no_of_children INTEGER,
    meal_plan VARCHAR(50),
    car_parking_space CHAR(1) CHECK (car_parking_space IN ('Y', 'N')),
    lead_time INTEGER,
    booking_status VARCHAR(20),
    booking_date DATE,
    no_of_nights INTEGER
);

CREATE TABLE Users (
    user_id SERIAL PRIMARY KEY,
    username VARCHAR(50) NOT NULL UNIQUE,
    user_password VARCHAR(255) NOT NULL
);

-- TRIGGERS AND FUNCTIONS

-- Update Hotel.total_bookings when a reservation is made
CREATE OR REPLACE FUNCTION update_booking_stats() RETURNS TRIGGER AS $$
BEGIN
    UPDATE Hotel SET total_bookings = total_bookings + 1
    WHERE hotel_id = NEW.hotel_id;
    RETURN NEW;
END;
$$ LANGUAGE plpgsql;

CREATE TRIGGER after_booking_insert
AFTER INSERT ON Booking
FOR EACH ROW EXECUTE FUNCTION update_booking_stats();

-- Update Hotel.total_bookings when a reservation is deleted
CREATE OR REPLACE FUNCTION delete_booking_stats() RETURNS TRIGGER AS $$
BEGIN
    UPDATE Hotel SET total_bookings = total_bookings - 1
    WHERE hotel_id = OLD.hotel_id;
    RETURN OLD;
END;
$$ LANGUAGE plpgsql;

CREATE TRIGGER after_booking_delete
AFTER DELETE ON Booking
FOR EACH ROW EXECUTE FUNCTION delete_booking_stats();

-- Procedure to cancel a booking
CREATE OR REPLACE FUNCTION cancel_booking(p_booking_id INTEGER) RETURNS VOID AS $$
BEGIN
    UPDATE Booking SET booking_status = 'Canceled'
    WHERE booking_id = p_booking_id;
    RAISE NOTICE 'Reservation % successfully canceled.', p_booking_id;
END;
$$ LANGUAGE plpgsql;

-- Procedure to generate a monthly report
CREATE OR REPLACE FUNCTION generate_monthly_report(p_hotel_id INTEGER, p_report_month TEXT) RETURNS VOID AS $$
DECLARE
    v_nameH VARCHAR(100);
    rec RECORD; -- Declare the loop variable as a RECORD
BEGIN
    -- Fetch hotel name
    SELECT nameH INTO v_nameH FROM Hotel WHERE hotel_id = p_hotel_id;

    -- Print report header
    RAISE NOTICE 'Reservation report for % for %', v_nameH, p_report_month;

    -- Loop through booking records
    FOR rec IN
        SELECT booking_date, no_of_nights, no_of_adults, no_of_children, meal_plan
        FROM Booking
        WHERE hotel_id = p_hotel_id
        AND TO_CHAR(booking_date, 'YYYY-MM') = p_report_month
        ORDER BY booking_date ASC
    LOOP
        -- Print each record's details
        RAISE NOTICE 'Reservation on %, Nights: %, Adults: %, Children: %, Meal Plan: %',
            rec.booking_date, rec.no_of_nights, rec.no_of_adults, rec.no_of_children, rec.meal_plan;
    END LOOP;
END;
$$ LANGUAGE plpgsql;

-- Function to calculate total cost
CREATE OR REPLACE FUNCTION calculate_total_cost_by_booking(p_booking_id INTEGER) RETURNS NUMERIC AS $$
DECLARE
    v_room_price NUMERIC(10, 2);
    v_meal_price NUMERIC(10, 2) := 0;
    v_total_cost NUMERIC(10, 2);
    v_room_id INTEGER;
    v_no_of_nights INTEGER;
    v_meal_plan VARCHAR(50);
    v_hotel_id INTEGER;
BEGIN
    SELECT room_id, no_of_nights, meal_plan, hotel_id
    INTO v_room_id, v_no_of_nights, v_meal_plan, v_hotel_id
    FROM Booking
    WHERE booking_id = p_booking_id;

    SELECT price INTO v_room_price
    FROM Room
    WHERE room_id = v_room_id AND hotel_id = v_hotel_id;

    IF v_meal_plan = 'Meal Plan 1' THEN
        v_meal_price := 50;
    ELSIF v_meal_plan = 'Meal Plan 2' THEN
        v_meal_price := 30;
    ELSIF v_meal_plan = 'Not Selected' THEN
        v_meal_price := 0;
    END IF;

    v_total_cost := (v_room_price * v_no_of_nights) + (v_meal_price * v_no_of_nights);
    RETURN v_total_cost;
END;
$$ LANGUAGE plpgsql;

-- SECURITY AND USER MANAGEMENT

-- Manager
-- Create role and user
CREATE ROLE manager_role;
CREATE USER manager_user WITH PASSWORD 'manager_password';

-- Grant privileges to manager_role
GRANT CONNECT ON DATABASE hotel_management TO manager_role;
GRANT SELECT ON Hotel TO manager_role;
GRANT SELECT, INSERT, UPDATE, DELETE ON Guest TO manager_role;
GRANT SELECT, INSERT, UPDATE, DELETE ON Booking TO manager_role;
GRANT SELECT ON Room TO manager_role;
GRANT SELECT, INSERT, UPDATE ON Staff TO manager_role;

-- Grant EXECUTE privilege for functions
GRANT EXECUTE ON FUNCTION generate_monthly_report TO manager_role;
GRANT EXECUTE ON FUNCTION calculate_total_cost_by_booking TO manager_role;
GRANT EXECUTE ON FUNCTION cancel_booking TO manager_role;

-- Assign role to the user
GRANT manager_role TO manager_user;

-- Employee
-- Create role and user
CREATE ROLE employee_role;
CREATE USER employee_user WITH PASSWORD 'employee_password';

-- Grant privileges to employee_role
GRANT CONNECT ON DATABASE hotel_management TO employee_role;
GRANT SELECT ON Hotel TO employee_role;
GRANT SELECT, UPDATE ON Guest TO employee_role;
GRANT SELECT, INSERT, UPDATE ON Booking TO employee_role;
GRANT SELECT ON Room TO employee_role;

-- Grant EXECUTE privilege for functions
GRANT EXECUTE ON FUNCTION calculate_total_cost_by_booking TO employee_role;
GRANT EXECUTE ON FUNCTION cancel_booking TO employee_role;

-- Assign role to the user
GRANT employee_role TO employee_user;

